            sdataHeap.set(new Uint8Array(spectrum_array.buffer));
            js_wrapped_spectrum(sdataPtr, spectrum_array.length);
            let sresult = new Float32Array(sdataHeap.buffer, sdataHeap.byteOffset, spectrum_array.length/2);
                spectrum = [];
            for (var i = 1; i <= sresult.length; i++) {
                spectrum.push ({y: Math.sqrt(sresult[i])});
            }    
            spectrumChart.options.data[0].dataPoints = spectrum;
            spectrumChart.render();
            DSPModule._free(sdataHeap.byteOffset);


        }
    </script>
</head>

    <div id="spectrum" style="height: 300px; width: 100%;"></div>
    <button onclick="plotOriginal()">Plot Original Signal</button>
    <button onclick="plotCorrectedECG()">Plot Signal Corrected with WASM</button>
